import React from "react";
import Element from "./Element";
import data from "periodic-table-website/src/PeriodicTable";

export default function PeriodicTable() {
  return (
    <div className="periodic-table">
      <Element
        elementName={data.elements[0].name}
        elementSymbol={data.elements[0].symbol}
        elementMass={data.elements[0].atomic_mass}
        elementNumber={data.elements[0].number}
      />
    </div>
  );
}
